import styled from "styled-components";

export const Button = styled.button`
    width: 365px;
    height: 54px;

    background-color: var(--yellow);
    border-radius: 8px;
    border: none;

    color: black;

    cursor: pointer;

    margin-top: 17px;

    :hover {
        width: 367px;
        height: 56px;
    }

`;
